import React from "react";
import { Button } from "@material-ui/core";
import Chat from "../components/Chat";
// import './styles.css';

import {
  EmailIcon,
  FacebookIcon,
  FacebookMessengerIcon,
  TumblrIcon,
  RedditIcon,
  WhatsappIcon,
  TwitterIcon,
} from "react-share";

class Music extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="App">
        <Button onClick={() => this.props.history.push("/")}>
          Go back to home
        </Button>
        <p>
          Welcome to music page.
          <Button>Share link</Button>
          <FacebookIcon size={36} round={true} />
          <FacebookMessengerIcon size={36} round={true} />
          <TwitterIcon size={36} round={true} />
          <TumblrIcon size={36} round={true} />
          <RedditIcon size={36} round={true} />
          <WhatsappIcon size={36} round={true} />
          <EmailIcon size={36} round={true} />
          <div>Music board goes here</div>
          <div>Select from sounds/beats</div>
          <Button>Download Music</Button>
        </p>
        <Chat />
      </div>
    );
  }
}

export default Music;
